        fetch('/getcart/')
        .then(res => res.json())
        .then(data => console.log(data))
    }

    function makeItems(cartData) {
        for ( let [item, amount] in cartData) {
            setCartItems(
                ...cartItems,
                <CartItem item={item} amount={amount} />
            )
        }        

    }



